import React from 'react';
import "./Card.css"

const Card = () => {
  return (
    <div className='container'>
        <div className='row'>
            <div className='col-md-12'>
                <h1>OUR DOCTOR VISITS AT HOME</h1>
            </div>
        </div>
    </div>
  )
}

export default Card
